double phi(double r, double s, int n) {
    int i, j, k;
    double sum = 0.;

    double R[size];

    int power = 0;
    k = 0;
    while (k <= n) {
        for (j = 0; j <= power; j++) {
            R[k] = pow(r, power - j) * pow(s, j);
            k++;
        }
        power++;
    }

    for (i = 0; i <= n; i++) {
        sum += basis_coeff[n][i] * R[i];
    }

    return sum;
}

double phi_x(double r, double s, int n) {
    int i, j, k;
    double sum = 0.;

    double R[size];

    R[0] = 0;
    k = 1;
    int power = 1;
    while (k <= n) {
        for (j = 0; j <= power; j++) {
            R[k] = (power - j) * pow(r, power - j - 1) * pow(s, j);
            if (j == power) {
                R[k] = 0;
            }
            k++;
        }
        power++;
    }

    for (i = 0; i <= n; i++) {
        sum += basis_coeff[n][i] * R[i];
    }

    return sum;
}

double phi_y(double r, double s, int n) {
    int i, j, k;
    double sum = 0.;

    double R[size];

    R[0] = 0;
    k    = 1;
    int power = 1;
    while (k <= n) {
        for (j = 0; j <= power; j++) {
            R[k] = pow(r, power - j) * j * pow(s, j - 1);
            if (j == 0) {
                R[k] = 0;
            }
            k++;
        }
        power++;
    }

    for (i = 0; i <= n; i++) {
        sum += basis_coeff[n][i] * R[i];
    }

    return sum;
}

double basis_check(double x, double y, int i) {
switch (i) {
        case 0: return 1.414213562373095;
        case 1: return -1.999999999999999 + 5.999999999999999*x;
        case 2: return -3.464101615137754 + 3.464101615137750*x + 6.928203230275512*y;
        case 3: return  2.449489742783153 + -1.959591794226528E+01*x + 1.648597081617952E-14*y + 2.449489742783160E+01*x*x;
        case 4: return  4.242640687119131E+00 + -2.545584412271482E+01*x + -8.485281374238392E+00*y + 2.121320343559552E+01 * x*x +  4.242640687119219E+01 * x*y;
        case 5: return  5.477225575051629E+00 + -1.095445115010309E+01*x + -3.286335345030997E+01*y + 5.477225575051381E+00 * x*x + 3.286335345031001E+01 * x*y +  3.286335345030994E+01 * y*y;
        case 9: return -7.483314773585763E+00 +
                        2.244994432091432E+01 * pow(x,1) +
                        8.979977728286150E+01 * pow(y,1) + 
                       -2.244994432106859E+01 * pow(x,2) +
                       -1.795995545666577E+02 * pow(x,1) * pow(y,1) +
                       -2.244994432069088E+02 * pow(y,2) +
                        7.483314773734342E+00 * pow(x,3) +
                        8.979977728384534E+01 * pow(x,2) * pow(y,1) +
                        2.244994432077823E+02 * pow(x,1) * pow(y,2) +
                        1.496662954711719E+02 * pow(y,3);
    }
    return -1;
}


void preval_basis(double *r1_local, double *r2_local, double *s_r, double *w_local, double *w_oned_local, 
                  int local_n_quad, int local_n_quad1d, int local_n_p) {
    double *basis_local        = (double *) malloc(local_n_quad * local_n_p * sizeof(double));
    double *basis_grad_x_local = (double *) malloc(local_n_quad * local_n_p * sizeof(double)); 
    double *basis_grad_y_local = (double *) malloc(local_n_quad * local_n_p * sizeof(double)); 
    double *basis_side_local   = (double *) malloc(3 * local_n_quad1d * local_n_p * sizeof(double));
    double *basis_vertex_local = (double *) malloc(3 * local_n_p * sizeof(double));

    int i, j;

    /*
    printf("x partial\n");
    for (i = 0; i < local_n_p; i++) {
        printf("phi_%i = %f\n", i, phi_x(0, 0, i) );
    }

    printf("y partial\n");
    for (i = 0; i < local_n_p; i++) {
        printf("phi_%i = %f\n", i, phi_y(0, 0, i) );
    }

    double test;
    for (i = 0; i < local_n_p; i++) {
        test = 0.;
        printf("phi_%i, w = ", i);
    }
    */

    for (i = 0; i < local_n_p; i++) {
        // precompute the values at the vertex points
        basis_vertex_local[i * 3 + 0] = phi(0., 0., i);
        basis_vertex_local[i * 3 + 1] = phi(1., 0., i);
        basis_vertex_local[i * 3 + 2] = phi(0., 1., i);

        //precompute the quadrature nodes on the elements for the basis & gradients
        for (j = 0; j < local_n_quad; j++) {
            basis_local[i * local_n_quad + j] = phi(r1_local[j], r2_local[j], i);
            basis_grad_x_local[i * local_n_quad + j] = w_local[j] * phi_x(r1_local[j], r2_local[j], i);
            basis_grad_y_local[i * local_n_quad + j] = w_local[j] * phi_y(r1_local[j], r2_local[j], i);
        }

        // precompute the quadrature nodes at the sides going in the clockwise direction
        for (j = 0; j < local_n_quad1d; j++) {
            basis_side_local[0 * (local_n_quad1d * local_n_p) + i * local_n_quad1d + j] = phi(0.5 + 0.5 * s_r[j], 0., i);
            basis_side_local[1 * (local_n_quad1d * local_n_p) + i * local_n_quad1d + j] = phi((1. - s_r[j])/2., (1. + s_r[j])/2., i);
            basis_side_local[2 * (local_n_quad1d * local_n_p) + i * local_n_quad1d + j] = phi(0., 0.5 + 0.5 * s_r[local_n_quad1d - 1 - j], i);
        }
    }

    /*
    for (i = 0; i < local_n_p; i++) {
        printf("phi_%i\n", i);
        for (j = 0; j < local_n_quad1d; j++) {
            printf(" (%f, %f, %f)\n", basis_side_local[0*local_n_quad1d*local_n_p + i*local_n_quad1d + j],basis_side_local[1*local_n_quad1d*local_n_p + i*local_n_quad1d + j],  basis_side_local[2*local_n_quad1d*local_n_p + i*local_n_quad1d + j]);
            printf(" check side 0: %f, %f \n", basis_side_local[0*local_n_quad1d*local_n_p + i*local_n_quad1d + j], basis_check(0.5 + 0.5 * s_r[j], 0., i));
            printf(" %f\n", s_r[j]);
        }
    }
    */

    set_basis(basis_local, local_n_quad * local_n_p);
    set_basis_grad_x(basis_grad_x_local, local_n_quad * local_n_p);
    set_basis_grad_y(basis_grad_y_local, local_n_quad * local_n_p);
    set_basis_side(basis_side_local, 3 * local_n_quad1d * local_n_p);
    set_basis_vertex(basis_vertex_local, 3 * local_n_p);
    set_w(w_local, local_n_quad);
    set_r1(r1_local, local_n_quad);
    set_r2(r2_local, local_n_quad);
    set_r_oned(s_r, local_n_quad1d);
    set_w_oned(w_oned_local, local_n_quad1d);

    free(basis_local);
    free(basis_grad_x_local);
    free(basis_grad_y_local);
    free(basis_side_local);
    free(basis_vertex_local);
}
